import React from 'react';

const Tap = () => {
  return (
    <div className='home'>
      <Tabs
                  value={value}
                  indicatorColor="primary"
                  textColor="primary"
                  onChange={handleChange}
                  aria-label="disabled tabs example"
                >
                  <Tab label="Profile" />
                  <Tab label="Transaction" disabled />
                  <Tab label="Health Report" />
                  <Tab label="Activity Log" />

                </Tabs>
    </div>
  );
};

export default Tap;
